from typing import List
import heapq

class Solution:
    def minimumObstacles(self, grid: List[List[int]]) -> int:
        # Dijkstra's Algorithm using Min Heap and a comparison grid
        rows = len(grid)
        cols = len(grid[0])
        grid1 = [[float('inf') for _ in range(cols)] for _ in range(rows)]
        grid1[0][0] = 0
        directions = [(0,1), (1,0), (0,-1), (-1,0)]
        h = list()
        heapq.heapify(h)
        heapq.heappush(h, (0, 0, 0))
        while h:
            #print(h)
            d, r, c = heapq.heappop(h)
            if r == rows - 1 and c == cols - 1:
                return d
            for dr, dc in directions:
                rnew = r + dr
                cnew = c + dc
                if 0 <= rnew < rows and 0 <= cnew < cols:
                    dnew = d + grid[rnew][cnew]
                    if dnew >= grid1[rnew][cnew]:
                        continue
                    heapq.heappush(h, (dnew, rnew, cnew))
                    grid1[rnew][cnew] = dnew
        return -1

